                                                                <div class="elementor-section-wrap">
                                                                    <section
                                                                        class="elementor-section elementor-top-section elementor-element elementor-element-239051bc elementor-section-full_width gt3_relative_section elementor-section-height-default elementor-section-height-default"
                                                                        data-id="239051bc" data-element_type="section"
                                                                        data-settings='{"background_background":"classic"}'>
                                                                        <div
                                                                            class="elementor-container elementor-column-gap-default">
                                                                            <div class="elementor-column elementor-col-100 elementor-top-column elementor-element elementor-element-6fd3d047"
                                                                                data-id="6fd3d047"
                                                                                data-element_type="column">
                                                                                <div
                                                                                    class="elementor-widget-wrap elementor-element-populated">
                                                                                    <div class="elementor-element elementor-element-602ecd6 gt3_absolute_block elementor-absolute elementor-widget elementor-widget-html"
                                                                                        data-id="602ecd6"
                                                                                        data-element_type="widget"
                                                                                        data-settings='{"_position":"absolute"}'
                                                                                        data-widget_type="html.default">
                                                                                        <div
                                                                                            class="elementor-widget-container">
                                                                                            <style type="text/css">
                                                                                                canvas#gt3_landing_canvas {
                                                                                                    background-color: transparent;
                                                                                                    width: 100%;
                                                                                                    height: 100%;
                                                                                                }
                                                                                            </style>
                                                                                            <canvas
                                                                                                id="gt3_landing_canvas"
                                                                                                width="1491"
                                                                                                height="378">
                                                                                            </canvas>
                                                                                            <script type="text/javascript">
                                                                                                (function() {
                                                                                                    var canvas =
                                                                                                        document.getElementById(
                                                                                                            "gt3_landing_canvas"
                                                                                                        ),
                                                                                                        can_w = parseInt(
                                                                                                            canvas.getAttribute(
                                                                                                                "width"
                                                                                                            )
                                                                                                        ),
                                                                                                        can_h = parseInt(
                                                                                                            canvas.getAttribute(
                                                                                                                "height"
                                                                                                            )
                                                                                                        ),
                                                                                                        ctx =
                                                                                                        canvas.getContext(
                                                                                                            "2d"
                                                                                                        );

                                                                                                    var ball = {
                                                                                                            x: 0,
                                                                                                            y: 0,
                                                                                                            vx: 0,
                                                                                                            vy: 0,
                                                                                                            r: 0,
                                                                                                            alpha: 1,
                                                                                                            phase: 0,
                                                                                                        },
                                                                                                        ball_color = {
                                                                                                            r: 209,
                                                                                                            g: 214,
                                                                                                            b: 218,
                                                                                                        },
                                                                                                        R = 7,
                                                                                                        balls = [],
                                                                                                        alpha_f = 0.03,
                                                                                                        alpha_phase = 0,
                                                                                                        // Line
                                                                                                        link_line_width = 0.8,
                                                                                                        dis_limit = 260,
                                                                                                        add_mouse_point = true,
                                                                                                        mouse_in = false,
                                                                                                        mouse_ball = {
                                                                                                            x: 0,
                                                                                                            y: 0,
                                                                                                            vx: 0,
                                                                                                            vy: 0,
                                                                                                            r: 0,
                                                                                                            type: "mouse",
                                                                                                        };

                                                                                                    // Random speed
                                                                                                    function getRandomSpeed(
                                                                                                        pos
                                                                                                    ) {
                                                                                                        var min = -1,
                                                                                                            max = 1;
                                                                                                        switch (pos) {
                                                                                                            case "top":
                                                                                                                return [
                                                                                                                    randomNumFrom(
                                                                                                                        min,
                                                                                                                        max
                                                                                                                    ),
                                                                                                                    randomNumFrom(
                                                                                                                        0.1,
                                                                                                                        max
                                                                                                                    ),
                                                                                                                ];
                                                                                                                break;
                                                                                                            case "right":
                                                                                                                return [
                                                                                                                    randomNumFrom(
                                                                                                                        min,
                                                                                                                        -0.1
                                                                                                                    ),
                                                                                                                    randomNumFrom(
                                                                                                                        min,
                                                                                                                        max
                                                                                                                    ),
                                                                                                                ];
                                                                                                                break;
                                                                                                            case "bottom":
                                                                                                                return [
                                                                                                                    randomNumFrom(
                                                                                                                        min,
                                                                                                                        max
                                                                                                                    ),
                                                                                                                    randomNumFrom(
                                                                                                                        min,
                                                                                                                        -0.1
                                                                                                                    ),
                                                                                                                ];
                                                                                                                break;
                                                                                                            case "left":
                                                                                                                return [
                                                                                                                    randomNumFrom(
                                                                                                                        0.1,
                                                                                                                        max
                                                                                                                    ),
                                                                                                                    randomNumFrom(
                                                                                                                        min,
                                                                                                                        max
                                                                                                                    ),
                                                                                                                ];
                                                                                                                break;
                                                                                                            default:
                                                                                                                return;
                                                                                                                break;
                                                                                                        }
                                                                                                    }

                                                                                                    function randomArrayItem(
                                                                                                        arr
                                                                                                    ) {
                                                                                                        return arr[
                                                                                                            Math.floor(
                                                                                                                Math.random() *
                                                                                                                arr.length
                                                                                                            )
                                                                                                        ];
                                                                                                    }

                                                                                                    function randomNumFrom(
                                                                                                        min,
                                                                                                        max
                                                                                                    ) {
                                                                                                        return (
                                                                                                            Math.random() *
                                                                                                            (max - min) +
                                                                                                            min
                                                                                                        );
                                                                                                    }
                                                                                                    // Random Ball
                                                                                                    function getRandomBall() {
                                                                                                        var pos =
                                                                                                            randomArrayItem([
                                                                                                                "top",
                                                                                                                "right",
                                                                                                                "bottom",
                                                                                                                "left",
                                                                                                            ]);
                                                                                                        switch (pos) {
                                                                                                            case "top":
                                                                                                                return {
                                                                                                                    x: randomSidePos(
                                                                                                                            can_w
                                                                                                                        ),
                                                                                                                        y: -R,
                                                                                                                        vx: getRandomSpeed(
                                                                                                                            "top"
                                                                                                                        )[0],
                                                                                                                        vy: getRandomSpeed(
                                                                                                                            "top"
                                                                                                                        )[1],
                                                                                                                        r: R,
                                                                                                                        alpha: 1,
                                                                                                                        phase:
                                                                                                                        randomNumFrom(
                                                                                                                            0,
                                                                                                                            10
                                                                                                                        ),
                                                                                                                };
                                                                                                                break;
                                                                                                            case "right":
                                                                                                                return {
                                                                                                                    x: can_w + R,
                                                                                                                        y: randomSidePos(
                                                                                                                            can_h
                                                                                                                        ),
                                                                                                                        vx: getRandomSpeed(
                                                                                                                            "right"
                                                                                                                        )[0],
                                                                                                                        vy: getRandomSpeed(
                                                                                                                            "right"
                                                                                                                        )[1],
                                                                                                                        r: R,
                                                                                                                        alpha: 1,
                                                                                                                        phase:
                                                                                                                        randomNumFrom(
                                                                                                                            0,
                                                                                                                            10
                                                                                                                        ),
                                                                                                                };
                                                                                                                break;
                                                                                                            case "bottom":
                                                                                                                return {
                                                                                                                    x: randomSidePos(
                                                                                                                            can_w
                                                                                                                        ),
                                                                                                                        y: can_h + R,
                                                                                                                        vx: getRandomSpeed(
                                                                                                                            "bottom"
                                                                                                                        )[0],
                                                                                                                        vy: getRandomSpeed(
                                                                                                                            "bottom"
                                                                                                                        )[1],
                                                                                                                        r: R,
                                                                                                                        alpha: 1,
                                                                                                                        phase:
                                                                                                                        randomNumFrom(
                                                                                                                            0,
                                                                                                                            10
                                                                                                                        ),
                                                                                                                };
                                                                                                                break;
                                                                                                            case "left":
                                                                                                                return {
                                                                                                                    x: -R,
                                                                                                                        y: randomSidePos(
                                                                                                                            can_h
                                                                                                                        ),
                                                                                                                        vx: getRandomSpeed(
                                                                                                                            "left"
                                                                                                                        )[0],
                                                                                                                        vy: getRandomSpeed(
                                                                                                                            "left"
                                                                                                                        )[1],
                                                                                                                        r: R,
                                                                                                                        alpha: 1,
                                                                                                                        phase:
                                                                                                                        randomNumFrom(
                                                                                                                            0,
                                                                                                                            10
                                                                                                                        ),
                                                                                                                };
                                                                                                                break;
                                                                                                        }
                                                                                                    }

                                                                                                    function randomSidePos(
                                                                                                        length
                                                                                                    ) {
                                                                                                        return Math.ceil(
                                                                                                            Math.random() *
                                                                                                            length
                                                                                                        );
                                                                                                    }

                                                                                                    // Draw Ball
                                                                                                    function renderBalls() {
                                                                                                        Array.prototype.forEach.call(
                                                                                                            balls,
                                                                                                            function(b) {
                                                                                                                if (
                                                                                                                    !b.hasOwnProperty(
                                                                                                                        "type"
                                                                                                                    )
                                                                                                                ) {
                                                                                                                    ctx.fillStyle =
                                                                                                                        "rgba(" +
                                                                                                                        ball_color.r +
                                                                                                                        "," +
                                                                                                                        ball_color.g +
                                                                                                                        "," +
                                                                                                                        ball_color.b +
                                                                                                                        "," +
                                                                                                                        b.alpha +
                                                                                                                        ")";
                                                                                                                    ctx.beginPath();
                                                                                                                    ctx.arc(
                                                                                                                        b.x,
                                                                                                                        b.y,
                                                                                                                        R,
                                                                                                                        0,
                                                                                                                        Math.PI * 2,
                                                                                                                        true
                                                                                                                    );
                                                                                                                    ctx.closePath();
                                                                                                                    ctx.fill();
                                                                                                                }
                                                                                                            }
                                                                                                        );
                                                                                                    }

                                                                                                    // Update balls
                                                                                                    function updateBalls() {
                                                                                                        var new_balls = [];
                                                                                                        Array.prototype.forEach.call(
                                                                                                            balls,
                                                                                                            function(b) {
                                                                                                                b.x += b.vx;
                                                                                                                b.y += b.vy;

                                                                                                                if (
                                                                                                                    b.x > -50 &&
                                                                                                                    b.x <
                                                                                                                    can_w + 50 &&
                                                                                                                    b.y > -50 &&
                                                                                                                    b.y < can_h + 50
                                                                                                                ) {
                                                                                                                    new_balls.push(
                                                                                                                        b
                                                                                                                    );
                                                                                                                }

                                                                                                                // alpha change
                                                                                                                b.phase +=
                                                                                                                    alpha_f;
                                                                                                                b.alpha =
                                                                                                                    Math.abs(
                                                                                                                        Math.cos(
                                                                                                                            b.phase
                                                                                                                        )
                                                                                                                    );
                                                                                                            }
                                                                                                        );

                                                                                                        balls =
                                                                                                            new_balls.slice(0);
                                                                                                    }

                                                                                                    // loop alpha
                                                                                                    function loopAlphaInf() {}

                                                                                                    // Draw lines
                                                                                                    function renderLines() {
                                                                                                        var fraction, alpha;
                                                                                                        for (
                                                                                                            var i = 0; i < balls.length; i++
                                                                                                        ) {
                                                                                                            for (
                                                                                                                var j = i + 1; j < balls.length; j++
                                                                                                            ) {
                                                                                                                fraction =
                                                                                                                    getDisOf(
                                                                                                                        balls[i],
                                                                                                                        balls[j]
                                                                                                                    ) / dis_limit;

                                                                                                                if (
                                                                                                                    fraction < 1
                                                                                                                ) {
                                                                                                                    alpha = (
                                                                                                                        1 - fraction
                                                                                                                    ).toString();

                                                                                                                    ctx.strokeStyle =
                                                                                                                        "rgba(208,213,216," +
                                                                                                                        alpha +
                                                                                                                        ")";
                                                                                                                    ctx.lineWidth =
                                                                                                                        link_line_width;

                                                                                                                    ctx.beginPath();
                                                                                                                    ctx.moveTo(
                                                                                                                        balls[i].x,
                                                                                                                        balls[i].y
                                                                                                                    );
                                                                                                                    ctx.lineTo(
                                                                                                                        balls[j].x,
                                                                                                                        balls[j].y
                                                                                                                    );
                                                                                                                    ctx.stroke();
                                                                                                                    ctx.closePath();
                                                                                                                }
                                                                                                            }
                                                                                                        }
                                                                                                    }

                                                                                                    // calculate distance between two points
                                                                                                    function getDisOf(
                                                                                                        b1,
                                                                                                        b2
                                                                                                    ) {
                                                                                                        var delta_x =
                                                                                                            Math.abs(
                                                                                                                b1.x - b2.x
                                                                                                            ),
                                                                                                            delta_y = Math.abs(
                                                                                                                b1.y - b2.y
                                                                                                            );

                                                                                                        return Math.sqrt(
                                                                                                            delta_x * delta_x +
                                                                                                            delta_y * delta_y
                                                                                                        );
                                                                                                    }

                                                                                                    // add balls if there a little balls
                                                                                                    function addBallIfy() {
                                                                                                        if (
                                                                                                            balls.length < 20
                                                                                                        ) {
                                                                                                            balls.push(
                                                                                                                getRandomBall()
                                                                                                            );
                                                                                                        }
                                                                                                    }

                                                                                                    // Render
                                                                                                    function render() {
                                                                                                        ctx.clearRect(
                                                                                                            0,
                                                                                                            0,
                                                                                                            can_w,
                                                                                                            can_h
                                                                                                        );

                                                                                                        renderBalls();

                                                                                                        renderLines();

                                                                                                        updateBalls();

                                                                                                        addBallIfy();

                                                                                                        window.requestAnimationFrame(
                                                                                                            render
                                                                                                        );
                                                                                                    }

                                                                                                    // Init Balls
                                                                                                    function initBalls(
                                                                                                        num
                                                                                                    ) {
                                                                                                        for (
                                                                                                            var i = 1; i <= num; i++
                                                                                                        ) {
                                                                                                            balls.push({
                                                                                                                x: randomSidePos(
                                                                                                                    can_w
                                                                                                                ),
                                                                                                                y: randomSidePos(
                                                                                                                    can_h
                                                                                                                ),
                                                                                                                vx: getRandomSpeed(
                                                                                                                    "top"
                                                                                                                )[0],
                                                                                                                vy: getRandomSpeed(
                                                                                                                    "top"
                                                                                                                )[1],
                                                                                                                r: R,
                                                                                                                alpha: 1,
                                                                                                                phase: randomNumFrom(
                                                                                                                    0,
                                                                                                                    10
                                                                                                                ),
                                                                                                            });
                                                                                                        }
                                                                                                    }
                                                                                                    // Init Canvas
                                                                                                    function initCanvas() {
                                                                                                        canvas.setAttribute(
                                                                                                            "width",
                                                                                                            window.innerWidth
                                                                                                        );
                                                                                                        canvas.setAttribute(
                                                                                                            "height",
                                                                                                            window.innerHeight
                                                                                                        );

                                                                                                        can_w = parseInt(
                                                                                                            canvas.getAttribute(
                                                                                                                "width"
                                                                                                            )
                                                                                                        );
                                                                                                        can_h = parseInt(
                                                                                                            canvas.getAttribute(
                                                                                                                "height"
                                                                                                            )
                                                                                                        );
                                                                                                    }
                                                                                                    window.addEventListener(
                                                                                                        "resize",
                                                                                                        function(e) {
                                                                                                            initCanvas();
                                                                                                        }
                                                                                                    );

                                                                                                    function goMovie() {
                                                                                                        initCanvas();
                                                                                                        initBalls(30);
                                                                                                        window.requestAnimationFrame(
                                                                                                            render
                                                                                                        );
                                                                                                    }
                                                                                                    goMovie();

                                                                                                    // Mouse effect
                                                                                                    canvas.addEventListener(
                                                                                                        "mouseenter",
                                                                                                        function() {
                                                                                                            mouse_in = true;
                                                                                                            balls.push(
                                                                                                                mouse_ball
                                                                                                            );
                                                                                                        }
                                                                                                    );
                                                                                                    canvas.addEventListener(
                                                                                                        "mouseleave",
                                                                                                        function() {
                                                                                                            mouse_in = false;
                                                                                                            var new_balls = [];
                                                                                                            Array.prototype.forEach.call(
                                                                                                                balls,
                                                                                                                function(b) {
                                                                                                                    if (
                                                                                                                        !b.hasOwnProperty(
                                                                                                                            "type"
                                                                                                                        )
                                                                                                                    ) {
                                                                                                                        new_balls.push(
                                                                                                                            b
                                                                                                                        );
                                                                                                                    }
                                                                                                                }
                                                                                                            );
                                                                                                            balls =
                                                                                                                new_balls.slice(
                                                                                                                    0
                                                                                                                );
                                                                                                        }
                                                                                                    );
                                                                                                    canvas.addEventListener(
                                                                                                        "mousemove",
                                                                                                        function(e) {
                                                                                                            var e =
                                                                                                                e || window.event;
                                                                                                            mouse_ball.x =
                                                                                                                e.pageX;
                                                                                                            mouse_ball.y =
                                                                                                                e.pageY;
                                                                                                        }
                                                                                                    );
                                                                                                })();
                                                                                            </script>
                                                                                        </div>
                                                                                    </div>
